INSERT INTO `services` (`id`, `service_name`, `service_description`, `service_terms`, `image`, `service_rate`, `is_active`, `is_deleted`, `created_by`, `updated_by`, `created_at`, `updated_at`) VALUES
(1, 'Hydrographic Survey', 'Hydrographic Surveying is an important civil engineering service that determines the physical features of an underwater area.  The user is advised to keep the following information’s ready before beginning of service requesting.  Purpose of study, location, type of water body, scale (line spacing), tentative data, Bench mark details and drawings or maps if available are the pre requisites.  The result of Hydrographic surveying will be provided in the form of bathy metric charts or xyz data in some cases.', NULL, NULL, '1000', 1, 0, 1, 55, '2022-12-24 21:58:52', '2023-03-01 18:15:33'),
(2, 'Tidal observation', 'Tidal observations mean continuous observations of regular eustatic sea level changes caused by tide generating forces such as sun and moon and atmospheric pressure, winds and more.  Tidal observation data is used for the purpose of determination of datum planes, establishment of tidal bench marks, publication of tide tables, maintenance of records of rise and fall of tide, study of tides and tidal phenomena etc prior to request in tidal observation data the user should be able to provide purpose, location, period and bench mark details if available', NULL, NULL, NULL, 1, 0, 1, 1, '2022-12-24 21:58:52', '2022-12-24 21:58:52'),
(3, 'Bottom sample collection', 'Bottom sediment sampling helps to learn about the mineral and chemical composition of floor of sea and other water bodies Hydrographic Survey Wing is capable of collection of samples only, (no analysis is done).  The location, depth of sampling, quantity etc. should be provided while requesting a bottom sample collection services', NULL, NULL, NULL, 1, 0, 1, 1, '2022-12-24 21:58:52', '2022-12-24 21:58:52'),
(4, 'Dredging Survey', 'Hydrographic Survey Wing conducts pre, post and intermediate dredging surveys and the data collected is used for volume estimation.  The user should specify the location, area to be dredged (boundaries) need for volume estimation and interim surveys.  While requesting the service mark details, User can also opt for method of volume computation', NULL, NULL, NULL, 1, 0, 1, 1, '2022-12-24 21:58:52', '2022-12-24 21:58:52'),
(5, 'Hydrographic data/charts', 'Hydrographic Survey Wing has a vast collection of Hydrographic data from previous years.  Which can be made available in the form of bathymetric charts or data in various formats like pdf, xyz etc., and the user can check the availability of data by visiting the HYMSYS portal by using the following link.\r\n<a href=\"https://hymsys.hsw.kerala.gov.in/\">www.hymsys.hsw.kerala.gov.in</a>', NULL, NULL, NULL, 1, 0, 1, 1, '2022-12-24 21:58:52', '2022-12-24 21:58:52'),
(6, 'Underwater videography', 'Hydrographic Survey Wing is providing underwater videography for capturing images and videos under water.  The user should be provide information about the location and type of water body to be captured ', NULL, NULL, NULL, 1, 0, 1, 1, '2022-12-24 21:58:52', '2022-12-24 21:58:52'),
(7, 'Current meter observations', 'Current meter are sensors that measure the rate of flow of water Hydrographic Survey Wing provides current meter observations taken as a part of bathymetric data collection.  The prerequisites for requesting the current meter observation data are information about location, type of water body and period of observation.\r\n', NULL, NULL, NULL, 1, 0, 1, 1, '2022-12-24 21:58:52', '2022-12-24 21:58:52'),
(8, 'Side scan sonar observation', 'Side scan sonar system are used for mapping the sea bed for a wide variety of purpose, including detection and identification of underwater wrecks, objects and bathy metric features.  Hydrographic Survey Wing is providing side scan sonar images & video record when requested.  The location and line interval for scanning should be provided by the user.', NULL, NULL, NULL, 1, 0, 1, 1, '2022-12-24 21:58:52', '2022-12-24 21:58:52'),
(9, 'Topographic survey', 'Hydrographic Survey Wing periodically conduct surveys for various Government departments.  The locations/area to be surveyed and tentative dates are planned prior to deciding the tentative survey program.', NULL, NULL, NULL, 1, 0, 1, 1, '2022-12-24 21:58:52', '2022-12-24 21:58:52'),
(10, 'Sub Bottom Profiling', 'Sub bottom profiling systems identify and measure various marine sediment layers that exist below the sediment/water interface.  It can be useful to detect hard substrate that has been covered by sedimentation.  Data can be provided as video records.  The location and line interval of scanning should provide by the user before requesting the data.', NULL, NULL, NULL, 1, 0, 1, 1, '2022-12-24 21:58:52', '2022-12-24 21:58:52'),
(11, 'Bathymetry Survey', 'Bathymetry Surveying is an important civil engineering service that determines the physical features of an underwater area. The user is advised to keep the following information’s ready before beginning of service requesting. Purpose of study, location, type of water body, scale (line spacing), tentative data, Bench mark details and drawings or maps if available are the pre requisites. The result of Hydrographic surveying will be provided in the form of bathy metric charts or xyz data in some cases.', NULL, NULL, '15', 1, 0, 1, 55, '2022-12-24 21:58:52', '2023-03-01 11:08:03');
